import React from 'react'
import {Box} from "./box"
export const board = ({board, onClick}) => {
    return(
        <div>
            {board.map((value,idx)=> {
                return <Box value={value} onClick={() => onClick(idx)}/>
            })}
        </div>    
    )
}
